INSERT INTO `livestreams` VALUES (1,2,'歌ってみたライブ！リクエスト募集中','皆さんからのリクエスト曲を歌っていきます！楽しんでくださいね♪','https://media.xiii.isucon.dev/api/7/playlist.m3u8','https://media.xiii.isucon.dev/yoru.webp',1690851600,1690855200),(2,3,'映画レビュー！最新映画の感想を語る','最新の映画について、感想や考察を深く掘り下げて話していきます。','https://media.xiii.isucon.dev/api/7/playlist.m3u8','https://media.xiii.isucon.dev/yoru.webp',1690851600,1690855200),(3,4,'新曲初披露！歌配信','オリジナルの新曲を初めて披露します！感想をお聞かせください！','https://media.xiii.isucon.dev/api/3/playlist.m3u8','https://media.xiii.isucon.dev/BBB.webp',1690851600,1690855200),(4,5,'最新ガジェット紹介！これは買い？','最新のテクノロジーガジェットを紹介していきます。','https://media.xiii.isucon.dev/api/11/playlist.m3u8','https://media.xiii.isucon.dev/timewarp.webp',1690851600,1690855200),(5,6,'健康トーク！毎日のワークアウト方法','健康的な生活のためのワークアウト方法や食事について話していきます。','https://media.xiii.isucon.dev/api/3/playlist.m3u8','https://media.xiii.isucon.dev/BBB.webp',1690851600,1690855200),(6,7,'アートライブ！絵を描きながらのんびりトーク','絵を描きながら、リラックスしたトークを楽しんでください。','https://media.xiii.isucon.dev/api/8/playlist.m3u8','https://media.xiii.isucon.dev/BBB.webp',1690855200,1690862400),(7,8,'プログラミングライブ！コードを書きながら学ぼう','初心者向けに、実際にコードを書きながらプログラミングを学んでいきます。','https://media.xiii.isucon.dev/api/10/playlist.m3u8','https://media.xiii.isucon.dev/yoru.webp',1690855200,1690862400),(8,9,'手相占いライブ！あなたの運命は？','手相をもとに、あなたの未来や運命を占います。','https://media.xiii.isucon.dev/api/9/playlist.m3u8','https://media.xiii.isucon.dev/timewarp.webp',1690855200,1690862400),(9,10,'コメディライブ！笑いでリフレッシュ','日常の出来事やニュースをユーモアたっぷりに解説します！笑顔で過ごしましょう！','https://media.xiii.isucon.dev/api/7/playlist.m3u8','https://media.xiii.isucon.dev/yoru.webp',1690855200,1690862400),(10,11,'ファッションライブ！今季のトレンドは？','最新のファッショントレンドやおすすめアイテムを紹介します！','https://media.xiii.isucon.dev/api/1/playlist.m3u8','https://media.xiii.isucon.dev/BBB.webp',1690855200,1690862400),(11,12,'アニメトーク！最新アニメの感想交換','最新のアニメについて、感想や考察をみんなで交換しましょう！','https://media.xiii.isucon.dev/api/9/playlist.m3u8','https://media.xiii.isucon.dev/timewarp.webp',1690862400,1690869600),(12,13,'ビジネスライブ！起業の秘訣','実